import './App.css';
import Tictac from './components/tictac';
import 'bootstrap/dist/css/bootstrap.min.css'
// import Puzzle from './components/Puzzle';
import { FcClock, FcDam } from "react-icons/fc";
import { FaBandcamp, FaArtstation } from "react-icons/fa";

function App() {
  return (
    <>
      <h1 className='bg-danger pb-5 x'>THIS IS HOME.JS</h1>
      <br></br>
      <FcClock />
      <FcDam />
      <FaBandcamp />
      <span>
        <FaArtstation />
      </span>

      <Tictac />
      {/* <Puzzle /> */}
    </>
  );
}

export default App;
